import React from 'react';
import styles from "./themeSwitcher.module.css"
import {UilPalette} from "@iconscout/react-unicons";

const ThemeSwitcher = () => {
    return (
        <div className={styles.themeSwitcher}>
            <UilPalette size={30}/>
        </div>
    );
};

export default ThemeSwitcher;
